import React from "react";
import ReactDOM from "react-dom";
import "./index.css";
import App from "./App";
import * as serviceWorker from "./serviceWorker";
import Application from "./components/Application";

ReactDOM.render(
  <React.StrictMode>
    <Application date={"hi"} />
  </React.StrictMode>,
  document.getElementById("root")
);

serviceWorker.unregister();
